import io
import base64
import ttkbootstrap as ttk
from PIL import Image, ImageTk
import tkinter.font as tkFont

# from Functions import Version
from tkinter.font import Font


def Window(self):
    self.W, self.H = 600, 700
    screen_width = self.winfo_screenwidth() / 2
    screen_width2 = screen_width + (screen_width / 2)
    screen_height = self.winfo_screenheight()
    print(screen_width2)
    center_x = int(screen_width2 - (self.W / 2))
    center_y = int(screen_height / 2 - (self.H / 2))
    self.geometry(f"{self.W}x{self.H}+{center_x}+{center_y}")
    self.minsize(600, 700)
    self.attributes("-fullscreen", False)


def Icon(self):
    b64_img = io.BytesIO(base64.b64decode(iconImage()))
    img = Image.open(b64_img, mode="r")
    photo = ImageTk.PhotoImage(image=img)
    self.wm_iconphoto(False, photo)


def create_widgets(self):
    Window(self)
    Icon(self)

    default_font = tkFont.nametofont("TkDefaultFont")
    default_font.configure(size=10, family="Poppins")
    self.option_add("*Font", default_font)

    paddingLG = {"padx": 13, "pady": 5}
    paddingLX = {"padx": 10, "pady": 0}
    paddingLA = {"padx": 10, "pady": 5}
    paddingLW = {"padx": 5, "pady": 5}
    topLabel = ttk.Label(self, text="AI Chat using OpenAI API", anchor=ttk.CENTER)
    topLabel.pack(anchor=ttk.NW, expand=True, fill=ttk.X, **paddingLA)

    self.lblFrame = ttk.LabelFrame(self, text="Chat Frame", borderwidth=2)
    self.lblFrame.pack(anchor=ttk.NW, expand=True, fill=ttk.BOTH, **paddingLX)

    self.lblFrame.rowconfigure(1, weight=1)

    self.chat_display = ttk.Text(
        self.lblFrame, borderwidth=2, wrap=ttk.WORD, relief=ttk.FLAT
    )
    self.chat_display.pack(anchor=ttk.NW, expand=True, fill=ttk.BOTH, **paddingLG)
    self.pic = ttk.PhotoImage(file="")
    # self.picFrame = ttk.Label(self.lblFrame, image=self.pic)
    # self.picFrame.pack(anchor=ttk.NW, expand=True, fill=ttk.BOTH, **paddingLG)

    scrollbars = ttk.Scrollbar(self.lblFrame, orient=ttk.VERTICAL)
    scrollbars.config(command=self.chat_display.yview)
    scrollbars.place(anchor=ttk.NE, relx=0.999, rely=0.00, relheight=1.00)

    self.chat_display.config(
        yscrollcommand=scrollbars.set,
        cursor="arrow",
        state=ttk.DISABLED,
        padx=15,  # noqa
    )
    self.chat_display.tag_configure(
        "USER", font=Font(family="Poppins", size=10, weight="bold")
    )
    self.chat_display.tag_configure(
        "BOT", font=Font(family="Poppins", size=10, weight="bold")
    )

    self.statusLabel = ttk.Label(
        self,
        text="Idle...",
        foreground="#707070",
        font=Font(family="Poppins", size=8, weight="bold"),
    )

    lblframe2 = ttk.LabelFrame(self, text="Controls", borderwidth=2)
    lblframe2.columnconfigure(0, weight=1)
    lblframe2.columnconfigure(1, weight=1)
    lblframe2.pack(anchor=ttk.SW, expand=True, fill=ttk.X, **paddingLA)

    self.statusLabel.pack(
        before=lblframe2,
        side="bottom",
        anchor=ttk.SW,
        expand=False,
        fill=ttk.X,
        **paddingLX,
    )

    self.chat_entry = ttk.Entry(lblframe2, width=362)
    self.chat_entry.bind("<Return>", self.on_submit)
    self.chat_entry.grid(column=0, row=1, **paddingLW)
    self.chat_entry.focus_set()

    self.button = ttk.Button(
        lblframe2, text="Send", command=lambda: self.on_submit(None)
    )  # noqa
    self.button.config(width=18)
    self.button.grid(column=3, row=1, **paddingLW)


def iconImage():
    return ""  # noqa
